  input: TEXT,"F3A","","Dear Mr. Hilland, Pursuant to your request for additional
    information letter dated January 30, 2007, the committee is filing this amendment
    reflecting the information required by said letter. Please note with regard your
    inquiry regarding the contributions by the committee to CRANELY FOR CONGRESS that
    it does appear that the The committee inadvertantly sent an additional amount
    that exceeded the limit. As discussed, I have contacted the committee and request
    a refund of the the excess amount. I have also followed up in writing and am forwarding
    a copy of said letter to your attention simultaneous with this amendment. Please
    be also advised that the amendment herewith should now properly reflect the items
    that your letter stated were received after the primary but designated for the
    primary. As discussed the items were actually sent and received prior to or on
    the primary day. In relation to the last item in your letter wherein you stated
    that the committee failed to provide an election designation, the committee has
    reviewed that information and ascertained that certain data did not import properly
